require('dotenv/config')

const axios = require('axios');

// The URL where you want to send the POST request
const url = 'https://mushroom.kindwise.com/api/v1/identification';

// The data you want to send in the request body (can be an object)
const data = {
    images: [''],
    latitude: 37,
    longitude: 42,
  };

// Custom headers
const headers = {
    'Api-Key': process.env.ID_API_KEY, // Replace with your authorization token
    'Content-Type': 'application/json', // Specify the content type
  };

axios.post(url, data, { headers })
  .then(response => {
    // Check if the response contains a result property
    if (response.data && response.data.result) {
      // Access the result section
      const result = response.data.result.classification.suggestions;
      console.log('Result:', result);
    } else {
      console.log('Response does not contain a result section.');
    }
  })
  .catch(error => {
    // Handle any errors here
    console.error('Error:', error);
  });
